import React from 'react';
import PropTypes from 'prop-types';
import styles from './home.module.css';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import logoNotas from '../../logoNotas.png';

import book from '../../book.png';



const Home = () => (
  <div className={styles.Home} data-testid="Home">
    <Box className={styles.nav} sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar className={styles.toolbar}>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon className={styles.icon} />
          </IconButton>
          <img src={logoNotas} alt="Logo Deep Bloc" className={styles.logo} />

          <Button className={styles.button} color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </Box>
    <div>   <p className={styles.txtbienvenida}>Convierte tus ideas en palabras y dales un hogar seguro.
      Solo tienes que hacer clic en el botón de inicio para empezar a escribir tu historia.
      ¡No dejes que tus ideas se escapen, atrápalas aquí y dale vida a tus pensamientos!</p></div>

    <Button variant="outlined" color='secondary' className={styles.btnEmpezar}>
      Empezar
    </Button>
    <div>

      <img src={book} alt="NoteBook" className={styles.book} />
    </div>
  </div >

);

Home.propTypes = {};

Home.defaultProps = {};

export default Home;
